import message from './Dialogs.module.css';
import {NavLink} from 'react-router-dom';


function DialogItem(props) {
    let path = "/dialogs/" + props.id
    return (
        <NavLink to={"/dialogs/" + props.id}>{props.name}</NavLink>
    );
}

function Dialogs() {
    return(
        <div className={message.dialogs}>
            <div className={message.notify}>
                <div className={message.dialogs_item}>
                    <DialogItem name={'Dimych'} id={'1'}/>
                </div>
                <div className={message.dialogs_item}>
                    <DialogItem name={'Evgeniy'} id={'2'}/>
                </div>
                <div className={message.dialogs_item}>
                    <DialogItem name={'Sasha'} id={'3'}/>
                </div>
            </div>
            <div className={message.paper_dial}>
                <div className={message.message_item}>Hello!</div>
                <div className={message.message_item}>How are your?</div>
                <div className={message.message_item}>Chel</div>
            </div>
        </div>
    );
}

export default Dialogs
